import React from 'react';

const Stats = () => {
  return (
    <section style={{ background: '#2c3e50', color: '#fff' }}>
      <div className="container" style={{ textAlign: 'center' }}>
        <h2>Company Statistics</h2>
        [cite_start]<p style={{ opacity: 0.7, marginBottom: '50px' }}>Why People say we are the best framing company in the world [cite: 88]</p>
        
        <div style={styles.statContainer}>
          <div style={styles.item}>
            <h3 style={styles.number}>150+</h3>
            <p>Projects Successfully Delivered</p>
          </div>
          <div style={styles.item}>
            <h3 style={styles.number}>85+</h3>
            <p>Skilled Developers & Designers</p>
          </div>
          <div style={styles.item}>
            <h3 style={styles.number}>10+</h3>
            <p>Years of Technical Excellence</p>
          </div>
        </div>
      </div>
    </section>
  );
};

const styles = {
  statContainer: { display: 'flex', flexWrap: 'wrap', justifyContent: 'space-around', gap: '30px' },
  item: { flex: 1, minWidth: '200px' },
  number: { fontSize: '3.5rem', color: '#2ecc71', margin: 0 }
};

export default Stats;
